import React, { Component } from 'react';
import ToDoItems from './ToDoList/components/todoitem/todoItems';
import AddItem from './ToDoList/components/AddItem/AddItem'
import CompletedList from './ToDoList/components/Completed/list';

class App extends Component {
  state = {
    items: [
      { id: 1, name: 'OOP' },
      { id: 2, name: 'Javascript' },
      { id: 3, name: 'C++' },
    ],
    doneItems: []
  }


  render() {
    return (
      <div className="App container">
        <h1 className="text-center">Lab 4</h1>
        <div>
          <ToDoItems items={this.state.items} />
          <AddItem />
        </div>
        <div className="Comlete">
          <CompletedList />
        </div>

      </div>
    );
  }
}

export default App;
